import React from 'react';

import IndexButtons from './components/IndexButtons';
import 'bootstrap/dist/css/bootstrap.min.css';

function App (props) {
	return (
		<Router>
			<Switch>
				<div className="app-container">
					<IndexButtons />:
				</div>
			</Switch>
		</Router>
	);
}

export default App;
